            font-size: 24px;
            background-color: rgba(0, 0, 0, 0.5);
            padding: 5px 10px;
            border-radius: 5px;
            z-index: 100;
        }
    </style>
</head>
<body>
    <div id="game">
        <div id="score">Токены: <span id="tokens">0</span></div>
        <div id="player"></div>
    </div>

    <script>
        const game = document.getElementById('game');
        const player = document.getElementById('player');
        const tokensElement = document.getElementById('tokens');
        let tokens = 0;
        
        // Начальные координаты игрока
        let playerX = 50;
        let playerY = 90;
        let isDragging = false;
        let touchStartX = 0;
        let touchStartY = 0;
        let initialPlayerX = 0;
        let initialPlayerY = 0;

        // Ограничения движения
        const playerWidth = 60;
        const playerHeight = 60;
        const minX = playerWidth/2;
        const maxX = 100 - playerWidth/2;
        const minY = playerHeight/2;
        const maxY = 100 - playerHeight/2;

        // Обработчики касаний
        game.addEventListener('touchstart', (e) => {
            e.preventDefault();
            const touch = e.touches[0];
            touchStartX = touch.clientX;
            touchStartY = touch.clientY;
            initialPlayerX = playerX;
            initialPlayerY = playerY;
            isDragging = true;
        });

        game.addEventListener('touchmove', (e) => {
            if (!isDragging) return;
            e.preventDefault();
            
            const touch = e.touches[0];
            const deltaX = touch.clientX - touchStartX;
            const deltaY = touch.clientY - touchStartY;
            
            // Преобразование пикселей в проценты
            const newX = initialPlayerX + (deltaX / window.innerWidth) * 100;
            const newY = initialPlayerY + (deltaY / window.innerHeight) * 100;
            
            // Ограничение движения
            playerX = Math.max(minX, Math.min(maxX, newX));
            playerY = Math.max(minY, Math.min(maxY, newY));
            
            updatePlayerPosition();
        });

        game.addEventListener('touchend', () => {
            isDragging = false;
        });

        function updatePlayerPosition() {
            player.style.left = `calc(${playerX}% - ${playerWidth/2}px)`;
            player.style.top = `calc(${playerY}% - ${playerHeight/2}px)`;
        }

        // Остальной код (создание врагов, стрельба) остается без изменений
        // ...
        
        // Инициализация позиции игрока
        updatePlayerPosition();

        // Основной игровой цикл
        function gameLoop() {
            requestAnimationFrame(gameLoop);
        }
        gameLoop();

        // Стрельба по долгому нажатию
        let shootInterval;
        game.addEventListener('touchstart', () => {
            shootInterval = setInterval(shoot, 300);
        });
        game.addEventListener('touchend', () => {
            clearInterval(shootInterval);
        });

        // Остальные функции (createEnemy, shoot) остаются аналогичными предыдущим версиям
    </script>
</body>
</html>
